var badPass='Weak: Use letters and numbers'
var goodPass='Medium: Use special characters'
var strongPass='Strong Password'
var sameAsUsername='Password is the same as username.'
function passwordStrength(password,username){score=0
if(password.length==0){$("#validation_result").css('color',"#D70000");return"Please enter the password"}
if(password.toLowerCase()==username.toLowerCase())return sameAsUsername
score+=password.length*4
score+=(checkRepetition(1,password).length-password.length)*1
score+=(checkRepetition(2,password).length-password.length)*1
score+=(checkRepetition(3,password).length-password.length)*1
score+=(checkRepetition(4,password).length-password.length)*1
if(password.match(/(.*[0-9].*[0-9].*[0-9])/))score+=5
if(password.match(/(.*[!,@,#,$,%,^,&,*,?,_,~].*[!,@,#,$,%,^,&,*,?,_,~])/))score+=5
if(password.match(/([a-z].*[A-Z])|([A-Z].*[a-z])/))score+=10
if(password.match(/([a-zA-Z])/)&&password.match(/([0-9])/))score+=15
if(password.match(/([!,@,#,$,%,^,&,*,?,_,~])/)&&password.match(/([0-9])/))score+=15
if(password.match(/([!,@,#,$,%,^,&,*,?,_,~])/)&&password.match(/([a-zA-Z])/))score+=15
if(password.match(/^\w+$/)||password.match(/^\d+$/))score-=10
if(score<0)score=0
if(score>100)score=100
if(score<34){$("#validation_result").css('color',"#D70000");return badPass}
if(score<68){$("#validation_result").css('color',"coral");return goodPass}
$("#validation_result").css('color',"green");return strongPass}
function passwordStrengthPercent(password,username){score=0
if(password.length<4){return 0}
if(password.toLowerCase()==username.toLowerCase())return 0
score+=password.length*4
score+=(checkRepetition(1,password).length-password.length)*1
score+=(checkRepetition(2,password).length-password.length)*1
score+=(checkRepetition(3,password).length-password.length)*1
score+=(checkRepetition(4,password).length-password.length)*1
if(password.match(/(.*[0-9].*[0-9].*[0-9])/))score+=5
if(password.match(/(.*[!,@,#,$,%,^,&,*,?,_,~].*[!,@,#,$,%,^,&,*,?,_,~])/))score+=5
if(password.match(/([a-z].*[A-Z])|([A-Z].*[a-z])/))score+=10
if(password.match(/([a-zA-Z])/)&&password.match(/([0-9])/))score+=15
if(password.match(/([!,@,#,$,%,^,&,*,?,_,~])/)&&password.match(/([0-9])/))score+=15
if(password.match(/([!,@,#,$,%,^,&,*,?,_,~])/)&&password.match(/([a-zA-Z])/))score+=15
if(password.match(/^\w+$/)||password.match(/^\d+$/))score-=10
if(score>100)return 100
return(score)}
function checkRepetition(pLen,str){res=""
for(i=0;i<str.length;i++){repeated=true
for(j=0;j<pLen&&(j+i+pLen)<str.length;j++)
repeated=repeated&&(str.charAt(j+i)==str.charAt(j+i+pLen))
if(j<pLen)repeated=false
if(repeated){i+=pLen-1
repeated=false}
else{res+=str.charAt(i)}}
return res}
